import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';

const Footer = () => {
  return (
    <div>
      <Container>
        <Jumbotron>
          (c)2021 giant meteorite crashing into our petulant planet productions
          ltd.
        </Jumbotron>
      </Container>
    </div>
  );
};

export default Footer;
